.app {
	position: absolute;
	width: 100%;
	background: url(../../assets/image/vip_learningreporter_bg@3x.png) no-repeat;
	background-size: 100% auto;
}
.report-name {
	width: 311px;
	margin: 0 auto;
	margin-top: 27px;
	p {
		color: #64442e;
		&:nth-of-type(1) {
			font-size: 24px;
		}
		&:nth-of-type(2) {
			font-size: 13px;
		}
	}
}
.report-content {
	width: 345px;
	height: 654px;
	background-color: #ffffff;
	border-radius: 10px;
	margin: 0 auto;
	margin-top: 39px;
	position: relative;
	.report-img-head {
		width: 100%;
		text-align: center;
		position: absolute;
		top: -22px;
		img {
			width: 120px;
			height: 30px;
		}
	}
	.report-img-1 {
		width: 84px;
		height: 77px;
		position: absolute;
		right: -20px;
		top: 35px;
		img {
			width: 100%;
			height: 100%;
		}
	}
	.report-day {
		width: 90%;
		margin: 0 auto;
		padding-top: 24px;
		p {
			font-size: 15px;
			color: rgba(0, 0, 0, 0.8);
			span {
				font-size: 24px;
				color: #ff8a66;
			}
		}
	}
	.grow-up,
	.potential {
		width: 90%;
		margin: 0 auto;
	}
	.potential-list {
		width: 100%;
		position: relative;
		span {
			color: #ff8a66;
			background-color: rgba(255, 138, 102, 0.12);
			border-radius: 18px;
			padding: 4px 8px;
			&:nth-of-type(1) {
				position: absolute;
				top: 55px;
				left: 93px;
				font-size: 25px;
			}
			&:nth-of-type(2) {
				position: absolute;
				top: 0px;
				left: 46px;
				font-size: 17px;
			}
			&:nth-of-type(3) {
				position: absolute;
				top: 0px;
				left: 164px;
				font-size: 15px;
			}
			&:nth-of-type(4) {
				position: absolute;
				top: 27px;
				right: 22px;
				font-size: 15px;
			}
			&:nth-of-type(5) {
				position: absolute;
				top: 62px;
				right: 0px;
				font-size: 12px;
			}
			&:nth-of-type(6) {
				position: absolute;
				top: 90px;
				right: 76px;
				font-size: 15px;
			}
			&:nth-of-type(7) {
				position: absolute;
				top: 119px;
				left: 142px;
				font-size: 12px;
			}
			&:nth-of-type(8) {
				position: absolute;
				top: 92px;
				left: 55px;
				font-size: 17px;
			}
			&:nth-of-type(9) {
				position: absolute;
				top: 62px;
				left: 0px;
				font-size: 15px;
			}
			&:nth-of-type(10) {
				position: absolute;
				top: 32px;
				left: 10px;
				font-size: 10px;
			}
		}
	}
}
.report-img-footer {
	width: 100%;
	position: relative;
	.report-img-2 {
		width: 51px;
		height: 44px;
		position: absolute;
		top: 11px;
		left: 62px;
		img {
			width: 100%;
			height: 100%;
		}
	}
	.report-img-3 {
		width: 118px;
		height: 65px;
		// position: absolute;
		top: -11px;
		left: 147px;
		img {
			width: 100%;
			height: 100%;
		}
	}
}
